import React, {useEffect, useState} from 'react';
import {Div, Header, Img, StyledCard, H2} from './posts';
import {HeartOutlined, SaveOutlined, SmallDashOutlined} from "@ant-design/icons";
import axios from "axios";

const Posts = () => {
    useEffect( () => {
        const getPostDate = async () => {
            await axios.get('/page')
                .then((res) => console.log(res))
                .catch((err) => console.error(err))
        }

        getPostDate();
    }, [])
    // const [postInfo, setPostInfo] = useState({
    //     username: '',
    //     imgUrl: '',
    // })
    return (
        <Div container>
            <Header>
                <H2>User Name</H2>
                <SmallDashOutlined style={{fontSize: '24px'}} />
            </Header>
            <StyledCard
                hoverable
                cover={<Img alt="example" src={process.env.PUBLIC_URL + '/Img/main-logo.png'} />}
            >
                <Div flex>
                    <HeartOutlined />
                    <SaveOutlined />
                </Div>
                <Div content>
                    <H2>posts content</H2>
                </Div>
            </StyledCard>
        </Div>
    );
};

export default Posts;
